import { Card, CardContent } from '@material-ui/core';

function MyCard(props) {
    const classes = useStyles();
    const useStyles = makeStyles({
        root: {
          minWidth: 275
        }
    });
  if (props.highlight) {
    return (
      <Card className={classes.root} variant="outlined" background="red"> 
        <CardContent>
          {props.value}
        </CardContent>
      </Card>
      );
  } else {
    return (
      <Card> 
        <CardContent>
          {props.value}
        </CardContent>
      </Card>
      );
  }

}

export default MyCard;
